INSERT INTO document_embeddings (id, document_id, chunk_index, chunk_content, embedding, created_at) VALUES ('d2556bb0-3888-4b61-92e7-81557e06e5c1', '2a2b1a8a0c6c7d21e1b9feb8242c642c', 0, 'Recent Articles / The heart beats about 2.5 billion times over the average lifetime, pushing millions of gallons of blood to every part of the body. This steady flow carries with it oxygen, fuel, hormones, other compounds, and a host of essential cells. It also whisks away the waste products of metabolism. When the heart stops, essential functions fail, some almost instantly. Given the heart''s never-ending workload, it''s a wonder it performs so well, for so long, for so many people. But it can also fail, brought down by a poor diet and lack of exercise, smoking, infection, unlucky genes, and more. A key problem is atherosclerosis. This is the accumulation of pockets of cholesterol-rich gunk inside the arteries.', '[-0.43608585000038147,0.3529527485370636,-0.09678934514522552,0.07825987786054611,0.11821670085191727,0.5195184946060181,0.08372592180967331,0.4845813810825348,-0.6931701898574829,-0.7306904792785645,0.6981616020202637,0.9492197036743164,-0.23054003715515137,-0.3075215220451355,-1.0407607555389404,0.07584527134895325,0.2366349995136261,0.2471223622560501,-0.3276752829551697,0.15047666430473328,0.02592114917933941,-0.0018707136623561382,-0.683751106262207,-0.024624556303024292,0.5794445872306824,-0.10786227136850357,-0.2896762192249298,-0.8219374418258667,-0.5100378394126892,-0.11403736472129822,-0.8575854301452637,-0.40594372153282166,0.08033797144889832,0.4566325843334198,0.49850568175315857,-0.12386500090360641,-0.17199446260929108,0.8816937804222107,0.38428589701652527,-0.14124365150928497,-0.14231589436531067,-0.3635183274745941,0.28154751658439636,-0.1893911361694336,-0.23332181572914124,-0.31865453720092773,0.22026677429676056,0.009496127255260944,-0.004223109222948551,0.8600130081176758,-0.643044114112854,-0.5830367803573608,-0.7493643164634705,0.197374403476715