INSERT INTO document_embeddings (id, document_id, chunk_index, chunk_content, embedding, created_at) VALUES ('d746853e-642f-479f-9c02-c2dbc3a5904c', '5487d4941ac113e3ca3e96228b0be208', 0, 'glucose, they turn to another fuel source called ketones, which are produced by the liver. Ketones are acidic, and an accumulation of them in the bloodstream can lead to a dangerous condition called ketoacidosis. Long-term, diabetes can cause several serious health problems. Excessive blood sugar damages blood vessels in the eyes, causing a condition called retinopathy, which can lead to blindness if left untreated. High blood glucose also damages nerves, often in the feet, legs, and hands. People with diabetes sometimes develop sores on their feet that they cannot feel because of nerve damage. When those sores go untreated, they can become deep skin ulcers that can take months to heal. Also, diabetes raises the risk of heart and kidney disease.', '[0.4563124477863312,-0.553261935710907,-0.13738827407360077,0.2544289827346802,0.6422120928764343,0.5704469084739685,0.6647639274597168,0.25359976291656494,0.5789585709571838,-0.1011383980512619,0.607900083065033,0.38483959436416626,-0.5445540547370911,0.07039113342761993,-0.7685433030128479,-0.3311931788921356,0.4959687292575836,0.4870842397212982,-0.0352008193731308,-0.5851573348045349,-0.24567967653274536,0.2131146341562271,-0.028777116909623146,-0.147224560379982,0.16781269013881683,0.18433107435703278,-0.634272038936615,-0.11441277712583542,0.18830445408821106,-0.07790297269821167,-0.7190279364585876,0.002137929666787386,0.5283688306808472,0.40952375531196594,-0.013132493942975998,-0.09268715977668762,-0.5214052200317383,0.4334830343723297,0.9144521355628967,-0.5746575593948364,0.25724083185195923,-0.40582185983657837,0.38812875747680664,-0.15321475267410278,-0.42135709524154663,-0.09282446652650833,0.37072744965553284,0.25349006056785583,0.459615021944046,0.1888221800327301,-0.5306685566902161,-0.14438262581825256,-0.1053042858839