INSERT INTO document_embeddings (id, document_id, chunk_index, chunk_content, embedding, created_at) VALUES ('2ae79d2f-07dd-45c4-94cc-ce1a5ad7b188', '7f9c70f05041c9689258026e9f105c7d', 0, 'the reasons why each happens differs. During digestion, food is broken down into basic components. Carbohydrates are broken down into simple sugars, primarily glucose. Glucose is a critically important source of energy for the body''s cells. To provide energy to the cells, glucose needs to leave the blood and get inside the cells. The hormone insulin produced by the pancreas and released into the bloodstream signals the body''s cells to take up glucose. When levels of glucose in the blood rise, like following a meal, the pancreas normally produces more insulin. Type 1 diabetes occurs when some or all of the insulin-producing cells in the pancreas are destroyed. This leaves the patient with little or no insulin.', '[0.1253090798854828,-0.8160805106163025,-0.06932836771011353,0.045616574585437775,0.09346432983875275,0.6120835542678833,0.42713072896003723,0.3916304111480713,0.8793062567710876,0.5594879984855652,0.6677162051200867,0.3681294918060303,-0.45026373863220215,-0.11667362600564957,-1.0184166431427002,-0.48115357756614685,0.3843979835510254,0.5038319826126099,-0.28636986017227173,0.12173714488744736,0.48647522926330566,0.41230353713035583,0.10998863726854324,-0.5501629114151001,-0.05766557902097702,-0.011778389103710651,-0.8089966177940369,-0.257918119430542,-0.014066245406866074,0.16055944561958313,-0.8434685468673706,-0.0166205745190382,0.20077306032180786,0.2074970304965973,-0.2673831284046173,0.08481289446353912,-0.5216202139854431,0.6762540936470032,0.7861618995666504,-0.7556731700897217,0.2654719054698944,0.12611915171146393,0.16735714673995972,0.2660508155822754,-0.14242757856845856,-0.6631621718406677,0.05210258811712265,-0.23572614789009094,-0.004902867134660482,0.3838628828525543,-0.24663181602954865,-0.457888126373291,-0.21160736680030823,-0.3392080068588257,0.2729