INSERT INTO document_embeddings (id, document_id, chunk_index, chunk_content, embedding, created_at) VALUES ('6829d2f2-7a2f-4ce5-a601-fa34d92df4c5', '01e3dc8d57e2c6242faf08ecf828ab20', 0, 'of the body. Type 1 diabetes is an autoimmune disease. This means it begins when the body''s immune system attacks cells in the body. In type 1 diabetes, the immune system destroys insulin-producing cells (beta cells) in the pancreas. Type 2 diabetes occurs when your body''s cells resist the normal effect of insulin, which is to drive glucose in the blood into the inside of the cells. This condition is called insulin resistance. As a result, glucose starts to build up in the blood. In people with insulin resistance, the pancreas "sees" the blood glucose level rising. The pancreas responds by making extra insulin to maintain a normal blood sugar level. Over time, the body''s insulin resistance gets worse. In response, the pancreas makes more and more insulin.', '[0.11687465757131577,-0.9751020073890686,0.045117881149053574,0.19026337563991547,0.022897444665431976,0.8132494688034058,0.5343592166900635,0.7101578712463379,1.007922649383545,0.5694761872291565,0.9251226782798767,0.28212451934814453,-0.26497793197631836,-0.1634351909160614,-0.5979170203208923,-0.41531461477279663,0.5318020582199097,0.45582935214042664,0.12330371886491776,0.30351904034614563,-0.0027300571091473103,-0.2880881428718567,-0.08776368200778961,-0.3960435390472412,-0.5420673489570618,0.09995687007904053,-0.4862070083618164,-0.20531849563121796,-0.10880733281373978,0.5256093144416809,-0.6267181634902954,-0.03086806833744049,0.34637951850891113,0.6987894773483276,-0.11185373365879059,0.023387862369418144,-0.18774622678756714,0.6201630234718323,0.32948216795921326,-0.708936870098114,0.43355920910835266,-0.2625076174736023,0.3374006152153015,0.0012332339538261294,-0.15131334960460663,-0.45516669750213623,0.3744494915008545,-0.18616582453250885,-0.16462789475917816,0.22477641701698303,0.10358615964651108,-0.649256885