INSERT INTO document_embeddings (id, document_id, chunk_index, chunk_content, embedding, created_at) VALUES ('dfde1b3d-f814-443e-bdcd-ee2ef4e40207', '35848021d526c0834bcd4a325e786f3b', 0, 'macronutrients and micronutrients. Macronutrients are carbohydrates, protein, and fat. They supply energy (in the form of calories) and serve as the building blocks for muscles and tissues. In comparison, micronutrients are individual vitamins and minerals . They are divided into four categories: water-soluble vitamins, fat-soluble vitamins, microminerals, and trace minerals. What foods are healthy? For optimal health, science supports following a plant-based diet like the Mediterranean-DASH (Dietary Approaches to Stop Hypertension) diet , and MIND (Mediterranean-DASH Diet Intervention for Neurodegenerative Delay) diet. Plant-based diets have been shown to have various health benefits and are linked with a lower risk of heart disease, cancer, and other chronic illnesses.', '[-0.07146725058555603,0.10108362138271332,0.04888279736042023,0.10787636786699295,0.6468715667724609,0.5759370923042297,0.2650424838066101,0.6842367053031921,-0.05497842654585838,-0.3004480004310608,0.1951509267091751,0.42403048276901245,-0.1762826144695282,-0.7904332280158997,-1.1557486057281494,-0.1324581354856491,-0.24760623276233673,0.3697652518749237,-0.670952320098877,-0.15147759020328522,-0.491860032081604,1.0770232677459717,-0.22299273312091827,-0.5380070209503174,0.15941834449768066,0.07118519395589828,-0.2961720824241638,-0.676316499710083,0.459884375333786,0.0998842716217041,-0.06063355132937431,-0.3395361006259918,0.34551069140434265,0.040703173726797104,-0.5670377612113953,-0.37457314133644104,0.1646159440279007,0.5878587961196899,0.6874923706054688,-0.4157520830631256,-0.13653697073459625,0.08461136370897293,-0.3196413218975067,0.03308510035276413,-0.535167932510376,-0.6763595938682556,-0.06929182261228561,-0.477243036031723,0.493445485830307,-0.1562531739473343,0.11841753870248795,0.2486764043569