INSERT INTO document_embeddings (id, document_id, chunk_index, chunk_content, embedding, created_at) VALUES ('b1236ff4-7eac-4b86-97dd-2d7ae2c70311', 'af9dde6b848cceaae6b978eaa5c4c1f6', 0, 'Despite advancements in surgical techniques and implant designs, Periprosthetic joint infection (PJI) continues to be one of the commonest and most devastating causes of failure in total joint arthroplasty. PJIs are associated with significant morbidity and mortality, placing a multifactorial burden on patients, caregivers, surgeons, hospitals, health systems, and economies. The incidence of PJI ranges from 0.5% to 2.3% based on current literature. Mortality rates in PJI subsequent to a primary total hip arthroplasty (THA) range from 4% to 8% after one year. The common treatment for PJI is a two-stage revision THA, which itself is associated with significant morbidity and mortality. The economic burden of PJI is substantial, with treatment costs 3 to 5.6 times higher than primary THA.', '[0.7151802182197571,-0.28698286414146423,0.16023851931095123,0.3561679720878601,-0.8812334537506104,0.1358194798231125,-0.34875190258026123,1.416264533996582,-0.6040776371955872,0.14832796156406403,0.3017314076423645,0.14051738381385803,0.09112414717674255,-0.8851838111877441,0.6635978817939758,-0.02806689217686653,0.8954118490219116,-0.1411622315645218,0.8868778944015503,-0.3898453414440155,0.14531175792217255,0.14116054773330688,0.3854595422744751,0.564907431602478,0.25895413756370544,0.931250274181366,0.20079553127288818,-0.559232234954834,0.4978499114513397,0.4808502793312073,-0.5087487697601318,0.9795904159545898,-0.5588535070419312,0.14198020100593567,0.58138507604599,-0.02333640493452549,0.006949050817638636,1.1133404970169067,0.03369932249188423,0.020339129492640495,0.30674245953559875,-0.5092952847480774,0.280511736869812,0.5598098635673523,0.9208933711051941,0.13697220385074615,0.3573950231075287,-0.04914052039384842,0.15777724981307983,-0.7870604395866394,-0.3343246877193451,0.164572492