INSERT INTO document_embeddings (id, document_id, chunk_index, chunk_content, embedding, created_at) VALUES ('968920ba-317e-403e-b445-cdb663acb1f1', 'e09341c3bc0b1c1254673e1a46c02cfe', 0, 'Opioid dependence is a chronic condition that can lead to significant harm if left untreated. People who experience opioid dependence and the treatments themselves are highly stigmatised. Person-centred trauma-informed services are critical to therapeutic engagement and effectiveness. Buprenorphine and methadone are highly effective, evidence-based medicines for opioid dependence. In recent years, long-acting injectable buprenorphine has emerged as a safe and effective treatment option, offering flexible weekly or monthly dosing. The long-term treatment of opioid dependence can be undertaken in primary care settings. General practitioner and nurse practitioner prescribing, and community pharmacist dispensing, are essential for ongoing care.', '[0.6141407489776611,0.24543213844299316,0.2925125062465668,0.04601726308465004,0.14067140221595764,0.09246475249528885,0.20527678728103638,0.07244914025068283,-0.329507440328598,-0.9288821220397949,0.4809989333152771,0.4228183925151825,0.2738615870475769,-0.46951237320899963,0.5805245041847229,0.1974099576473236,-0.13713639974594116,0.8467939496040344,0.16131754219532013,-0.4180494546890259,-0.4685230553150177,0.28973954916000366,-0.44663918018341064,0.20632337033748627,-0.1652427315711975,-0.4378024637699127,-0.3615943193435669,-0.45225971937179565,0.025762414559721947,0.1122358962893486,-0.7955402731895447,0.09120079129934311,-0.4154565930366516,0.03591487929224968,-0.012227044440805912,-0.3050146996974945,0.36160290241241455,0.9040850400924683,-1.6278941631317139,0.3932996392250061,-0.8183885216712952,0.928644597530365,-0.12949860095977783,-0.6593179106712341,-0.31744012236595154,-0.3158469796180725,0.0962306410074234,0.23088277876377106,-0.032625358551740646,-0.029637375846505165,-0.06329136341810226,-0.20710580050945282,0.34516689181327