INSERT INTO document_embeddings (id, document_id, chunk_index, chunk_content, embedding, created_at) VALUES ('91cbca58-ca5f-40f8-89de-235e93c29127', '8b26552a64e5af970f5f325c543ffa82', 0, 'Chronic kidney disease (CKD) affects 1015% globally and is a marked independent risk factor for cardiovascular disease. Prevalence estimations are essential for public health planning and implementation of CKD treatment strategies. This study aimed to estimate the prevalence and stages of CKD in the population-based Lolland-Falster Health Study, set in a rural provincial area with the lowest socioeconomic status in Denmark. Additionally, the study characterized participants with CKD, evaluated the overall disease recognition, including the awareness of CKD and compared it with other common conditions. Cross-sectional data were obtained from clinical examinations, biochemical analyses, and questionnaires.', '[0.4380143880844116,0.48391759395599365,0.490895539522171,0.5075563788414001,-0.12700052559375763,-0.45052337646484375,0.7781611680984497,-0.3945852518081665,-1.3364487886428833,0.03556143119931221,-0.35072463750839233,0.31316807866096497,0.7063717246055603,0.5463723540306091,0.23019427061080933,0.253158301115036,0.04311748966574669,0.7287516593933105,0.3986950218677521,-0.3835565745830536,-0.9011528491973877,0.21710479259490967,-0.5944840312004089,0.6005898714065552,-0.3666876256465912,-0.019946886226534843,0.05008237063884735,-0.06293149292469025,-0.18503324687480927,-0.66351717710495,0.5439659953117371,-0.7180649638175964,0.7327616214752197,-0.45894163846969604,0.4970099627971649,0.1945795714855194,0.06675087660551071,-0.7351350784301758,-0.8711840510368347,0.8785374164581299,-0.40763962268829346,-0.9069400429725647,0.21183237433433533,-1.0085810422897339,0.2241005003452301,-0.2511861324310303,-0.4660102128982544,0.5779711008071899,0.3985024094581604,0.29147347807884216,-0.7794651389122009,0.9742361903190613,0.21300214529037476,0.4092049300670624,0.8196936845779419,-0.347347