INSERT INTO document_embeddings (id, document_id, chunk_index, chunk_content, embedding, created_at) VALUES ('3e2267df-742c-47f8-94e4-8a5be769badb', '74c6da68b5927a4b0ba8e3ed5734e4e5', 0, 'This study investigated the relationship between the weight-adjusted-waist index (WWI), calculated as waist circumference (WC) divided by the square root of weight, and the risk of 3 types of urinary incontinence (UI) in women. Data from the National Health and Nutrition Examination Survey spanning 2007 to 2020 were analyzed, including 7236 female participants aged 20 years and older. UI types (stress UI [SUI], urgency UI [UUI], and mixed UI [MUI]) were classified based on self-reported questionnaires. Multivariate logistic regression models were used to assess the association between WWI and UI, adjusting for covariates such as age, race, marital status, education level, and comorbidities.', '[0.41924506425857544,0.07537908852100372,-0.18991628289222717,0.43125274777412415,-0.5087125897407532,-0.060340169817209244,0.26405760645866394,-0.3623979687690735,0.058188874274492264,0.8457558751106262,-0.1529863178730011,0.2714841365814209,0.22534750401973724,0.19255183637142181,-0.04972740635275841,0.06293915212154388,0.9505944848060608,0.729859471321106,-0.5461370348930359,-0.6460887789726257,-0.7182666063308716,-0.17826464772224426,-0.4889780580997467,0.6039000153541565,0.7480372190475464,-0.034078288823366165,0.5576074123382568,0.045588571578264236,-0.02512257732450962,-0.45660680532455444,0.11381549388170242,0.04735630750656128,0.1528567373752594,0.21160008013248444,0.8126763701438904,-0.18753394484519958,-0.03205393627285957,0.5738792419433594,-0.17006294429302216,0.8957984447479248,-0.33644625544548035,-0.7711451649665833,0.10430274158716202,-0.859467089176178,0.3768080472946167,-0.044067975133657455,-0.2962036430835724,0.4165080487728119,0.9036321043968201,0.9025903344154358,-0.2264097034931183,0.014311808161437511,0.6822501420974731,-0.33583864569664,-0.2404337078332901,0.4768673