INSERT INTO document_embeddings (id, document_id, chunk_index, chunk_content, embedding, created_at) VALUES ('76cf4f20-9e42-4c42-8e46-1a8c9f6bc1dc', 'c9bb227b8be1de39c2fe38b50b0e4b16', 0, 'Current care and research pathways for amyotrophic lateral sclerosis (ALS) primarily rely on regularly scheduled visits to specialized centers. These visits provide intermittent clinical information to health care professionals and require patients to travel to the clinic. Digital health technologies enable continuous data collection directly from the patient''s home, bringing new opportunities for personalized, timely care and a refined assessment of disease severity in clinical trials. In this review, we summarize the state of the art in digital health technologies for remote monitoring of patients with ALS, ranging from televisits through videoconferencing to sensor-based wearable devices. We explore how these technologies can benefit clinical care and advance treatment development.', '[0.042611945420503616,-0.3394886553287506,-0.34658706188201904,-0.35193368792533875,-0.5424209833145142,0.8933092951774597,0.30211693048477173,-0.7668353915214539,-0.35840338468551636,-0.5938355326652527,-0.6098254323005676,-0.04732736945152283,0.19786228239536285,-0.2125198245048523,0.21931521594524384,-0.33798277378082275,0.6922292113304138,0.32077670097351074,-0.17628446221351624,-0.5698188543319702,-0.46117401123046875,0.240055650472641,0.1173643246293068,-0.32870781421661377,-0.050068631768226624,-0.08165516704320908,0.0678425282239914,0.19257207214832306,0.034441906958818436,-0.40527382493019104,-0.1360618770122528,-0.12035726755857468,0.03592578321695328,0.5939238667488098,-0.1242331713438034,-0.06205964833498001,-0.29431426525115967,0.5338180065155029,0.5392445921897888,0.1590331792831421,0.7285398840904236,0.7836530804634094,-0.16128090023994446,-0.0003588016552384943,0.07079514861106873,0.27055686712265015,0.4212383031845093,-0.07870529592037201,-0.11745048314332962,-0.21144208312034607