INSERT INTO document_embeddings (id, document_id, chunk_index, chunk_content, embedding, created_at) VALUES ('c6f46cc4-0887-49fd-ad9f-3702be09823e', '1f10f1b15cf4d998845c9f901a0a8220', 0, 'Hodgkins lymphoma (HL) is a lymphoid malignancy with an emphasized incidence in developed countries. This study aimed to assess the changes in the epidemiology of HL in Finland at the population level by utilizing data from six nationwide healthcare registries. A total of 2912 patients with HL, diagnosed and treated between 2000 and 2019 were matched by controls and divided into younger (<50 years) and older cohorts (50 years) for analysis. A slightly increasing trend in incidence per age group was observed. For the younger patients, the mean annual incidence was 3.19 for males and 2.89 for females. For the older patients, it was 3.07 and 1.59, respectively.', '[0.31568241119384766,-0.951565146446228,-0.07612652331590652,-0.06065275892615318,-0.2919637858867645,-0.3342292308807373,1.1776599884033203,-0.7546489834785461,-1.2685298919677734,0.409801721572876,-0.08312345296144485,0.5864506959915161,0.33596453070640564,0.044155221432447433,0.5173717737197876,0.33878323435783386,0.8371851444244385,0.4728468656539917,0.32381534576416016,-0.10937608033418655,0.28420740365982056,0.6270719170570374,-0.33758479356765747,0.6718956232070923,-0.8530731797218323,-0.5010913610458374,-0.1688949316740036,-0.19218899309635162,0.20204442739486694,-0.010646006092429161,0.11617729812860489,-0.2578551769256592,0.5395557284355164,0.19854483008384705,0.4392307996749878,0.19882631301879883,0.6831682920455933,-0.693114161491394,-0.3959106504917145,0.5117250084877014,0.46184223890304565,0.10273557156324387,0.35043540596961975,-0.7670642733573914,0.5675577521324158,-0.6042572259902954,-0.14374636113643646,0.03906037285923958,-0.09389293938875198,-0.6205923557281494,-0.5389953255653381,0.05599753558635712,0.02085179090499878,-0.04723755642771721,0.14476627111434937,-0.9938928484916687,0.288465678691864,-0.069